Kath &amp; Kim is a character-driven Australian television satirical situation comedy series created by Jane Turner and Gina Riley. Turner and Riley also play the title characters: a suburban mother and daughter with a dysfunctional relationship. The series' main characters consist of Kath Day-Knight, a cheerful 50-year-old woman, her self-indulgent daughter Kim Craig, Kath's boyfriend and second husband, the metrosexual Kel Knight, as well as Kim's estranged husband Brett Craig and her lonely, overweight &quot;second best friend&quot; Sharon Strzelecki. The series is set in Fountain Lakes, a fictional suburb of Melbourne, Victoria. It is primarily filmed in Patterson Lakes.[1] The series lampoons suburban living, particularly kitsch lower-middle-class Australian people, who are colloquially known in the country as &quot;bogans&quot;
